    def test_merges_activities(self):
        clean_db()
        nuke_cache()
        for query in self.cypher_queries:
            q = query.strip()
            if q != '':
                db.cypher_query(q)
        R = RDFPostProcessor()

        a1_source_uri = "https://1145.am/db/5302672/Ryuichi_Isaka-None-Chief_Executive"
        a1_target_uri = "https://1145.am/db/5302672/Stephen_Dacus-Starting-Chief_Executive"
        a1_s = Resource.get_by_uri(a1_source_uri)
        a1_t = Resource.get_by_uri(a1_target_uri)
        assert a1_s.internalMergedActivityWithSimilarRelationshipsToUri is None
        assert a1_t.withRole.relationship(a1_t.withRole[0]).weight == 1
        # assert a1_t.internalMergedEquivalentActivityAt is None

        a2_source_uri = "https://1145.am/db/5302873/Seven_I_Holdings-Investment"
        a2_target_uri = "https://1145.am/db/5302873/York_Holdings-Acquisition"
        a2_s = Resource.get_by_uri(a2_source_uri)
        a2_t = Resource.get_by_uri(a2_target_uri)
