        assert a2_t.investor.relationship(Resource.get_by_uri("https://1145.am/db/331244/Seven_I_Holdings")).weight == 1
        # assert a2_t.internalMergedEquivalentActivityAt is None

        a3_source_uri = "https://1145.am/db/5293762/Harris_Teeter-Added-Lumina_Commons"
        a3_target_uri = "https://1145.am/db/5293762/Harris_Teeter-Added-Wilmington"
        a3_s = Resource.get_by_uri(a3_source_uri)
        a3_t = Resource.get_by_uri(a3_target_uri)
        a3_t_target = a3_t.locationAdded.filter(internalMergedSameAsHighToUri__isnull=True)[0]
        assert a3_s.internalMergedActivityWithSimilarRelationshipsToUri is None
        assert a3_t.locationAdded.relationship(a3_t_target).weight == 1
        # assert a3_t.internalMergedEquivalentActivityAt is None

        R.run_all_in_order()

        a1_s = Resource.get_by_uri(a1_source_uri)
        a1_t = Resource.get_by_uri(a1_target_uri)
        assert a1_s.internalMergedActivityWithSimilarRelationshipsToUri == a1_target_uri
        assert a1_t.withRole.relationship(a1_t.withRole[0]).weight == 2
        # assert a1_t.internalMergedEquivalentActivityAt is not None

        a2_s = Resource.get_by_uri(a2_source_uri)
        a2_t = Resource.get_by_uri(a2_target_uri)
        assert a2_s.internalMergedActivityWithSimilarRelationshipsToUri == a2_target_uri
        assert a2_t.investor.relationship(Resource.get_by_uri("https://1145.am/db/331244/Seven_I_Holdings")).weight == 2
        # assert a2_t.internalMergedEquivalentActivityAt is not None

        a3_s = Resource.get_by_uri(a3_source_uri)
        a3_t = Resource.get_by_uri(a3_target_uri)
        a3_t_target = a3_t.locationAdded.filter(internalMergedSameAsHighToUri__isnull=True)[0]
        assert a3_s.internalMergedActivityWithSimilarRelationshipsToUri == a3_target_uri
        assert a3_t.locationAdded.relationship(a3_t_target).weight == 2
